import React, { Component } from 'react';

class App extends Component {
  render() {
    return (
       <div className="container">
        <div className="col-xs-12">
        <h1>Kamion React Project</h1>
          <div className="card">
            <div className="card-body">
              <h3 className="card-title">Country Name</h3>

            </div>
          </div>
        </div>
       </div>
    );
  }
}
export default App;
